import React from 'react';
import Checkbox from './Checkbox';
import Input from './Input';
import Select from './Select';

class App extends React.Component {
  
  constructor(props) {
    super(props);
    this.state = {
      // shouldRemoveBox: false,
    };
    this.ageGroup = ["0-15","16-34","35-90"];
  }
 
  render(){
    return (
			<form className="ui form">
				<Input text="First Name:"></Input>
				<Input text="Last Name:"></Input>
				<Select text="Age:" group={this.ageGroup}></Select>
				{/* <Checkbox isChecked={false} text="I accept the term of the app"></Checkbox> */}
			</form>);

  }
}

export default App;
